class Hello{

	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner){

		this.log = log
		this.context = context
		this.testRunner = testRunner		
	}

	def sayHello(){

		log.info("          Saying Hello World....");



	}



}

